import React, { useState } from 'react';
import axios from 'axios'; // Import axios
import './SearchBySchemes.css';

const SearchByScheme = ({ searchOption, placeholder }) => {
  const [input, setInput] = useState('');
  const [results, setResults] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleSearch = async (e) => {
    e.preventDefault();
    setError('');
    setResults([]);
    let query = '';
    if (searchOption === 'schemeid' && input) query = `schemeid=${input}`;
    if (searchOption === 'schemename' && input) query = `schemename=${input}`;
    try {
      const res = await fetch(`/api/schemes/search${query ? '?' + query : ''}`);
      if (!res.ok) throw new Error('No results found');
      const data = await res.json();
      if (!data.length) setError('No results found');
      setResults(data);
    } catch (err) {
      setError('Error fetching results');
    }
  };

  const handleClear = () => {
    setInput('');
    setResults([]);
    setError('');
  };

  return (
    <div className="search-by-scheme-container">
      <h3>Search by Scheme</h3>
      <form onSubmit={handleSearch}>
        <input
          type="text"
          placeholder={placeholder}
          value={input}
          onChange={e => setInput(e.target.value)}
          aria-label="Scheme Name"
        />
        <div className="button-container">
          <button type="submit">Search</button>
          <button onClick={handleClear} disabled={!input}>Clear</button>
        </div>
      </form>

      {loading && <p>Loading...</p>}
      {error && <p className="error-message">{error}</p>}

      {results.length > 0 && (
        <div className="table-responsive">
          <table className="customer-table">
            <thead>
              <tr>
                <th>S.No</th>
                <th>Username</th>
                <th>First Name</th>
                <th>Last Name</th>
                <th>Phone No</th>
                <th>Email ID</th>
                <th>Aadhar No</th>
                <th>PAN No</th>
                <th>Acc. No</th>
                <th>IFSC Code</th>
                <th>Bank Account Name</th>
                <th>Won Bid</th>
                <th>Won Bid Month</th>
              </tr>
            </thead>
            <tbody>
              {results.map((customer, index) => {
                const wonBidInfo = customer.schemes_registered.find(scheme => scheme.scheme_id === input);
                return (
                  <tr key={index}>
                    <td>{index + 1}</td>
                    <td>{customer.username}</td>
                    <td>{customer.fname}</td>
                    <td>{customer.lname}</td>
                    <td>{customer.phone_number}</td>
                    <td>{customer.email}</td>
                    <td>{customer.aadharno}</td>
                    <td>{customer.panno}</td>
                    <td>{customer.acc_num}</td>
                    <td>{customer.ifsc_code}</td>
                    <td>{customer.bank_account_name}</td>
                    <td>{wonBidInfo ? (wonBidInfo.has_won_bid ? 'Yes' : 'No') : 'No'}</td>
                    <td>{wonBidInfo && wonBidInfo.has_won_bid ? wonBidInfo.won_bid_month : 'N/A'}</td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default SearchByScheme;
